import { Button, Container, Typography,Box } from "@mui/material"
import theme from "../components/Theme"




export const Footer = () => {

    const flexBox = {
        display: 'flex',
        flexDirection: 'column',
        alignItems:'center',
        justifyContent:'center',
        gap:'50px',
        [theme.breakpoints.down('md')]:
        {
            padding:'0px',
            fontSize:'20px'
        }
        
    }
    const typographyStyles = {
        background: 'linear-gradient(89.97deg, #AE67FA 1.84%, #F49867 102.67%)',
        WebkitBackgroundClip: 'text',
        backgroundClip: "text",
        color: 'transparent',
        fontWeight: '500'
    }
    const buttonStyles={
        textTransform:'capitalize',
        color:'white',
        borderColor:'white',
        borderRadius:'0',
        padding:'10px',
        paddingLeft:'50px',
        paddingRight:'50px',
        [theme.breakpoints.down('md')]:
        {
            padding:'0px',
            fontSize:'20px'
        }




    }
    const containerStyles={
        padding:'100px',
        [theme.breakpoints.down('md')]:
        {
            padding:'0px',
         }
    }
    return (
        <>
            <Container maxWidth={'xl'} fixed sx={{marginTop:'100px',background:'#031B34',...containerStyles}}>
                <Box sx={{...flexBox}}>
                    <Typography align="center" variant="h2" sx={{...typographyStyles,paddingLeft:'250px',paddingRight:'250px'}}>
                        Do you want to step in to the future before others

                    </Typography>
                    <Button variant="outlined" size="large" sx={{...buttonStyles}}>
                        Request Early Access

                    </Button>
                </Box>


            </Container>

        </>
    )
}
